import React, { Component } from 'react';
import { Route, Switch } from 'react-router-dom';
// import jwtDecode from 'jwt-decode';
import Todo from './components/todo/_index';
import Navbar from './components/todo/topbar/navbar';
// import Login from './components/todo/topbar/login2';
import Login from './/';

// import Register from './components/todo/topbar/register';
import Register from './components/todo/topbar/register2';

import {listStorage} from './components/todo/storage/list';
import FinishedTasks from './components/todo/archived_finishedTasks';
import axios from 'axios';
// import jwtDecode from 'jwt-decode';

class App extends Component {
  state = {
    list: [],
    displayFinishedTags: true,
  }

  componentDidMount = async()=>{
    const list = listStorage();
    this.setState({list});


    const response = await axios.get('/api/hello');
    console.log('response', response.data );


    // const data = await axios.get('/rand');
    // console.log('data', data);
    // try{
    //   const jwt = localStorage.getItem('token');
    //   const user = jwtDecode(jwt);
    //   console.log('storage',user);
    //   this.setState({user});
    // }catch(ex){}
  }

  render() { 
    return (
      <React.Fragment>
        <Navbar data={this.state.user} user={this.state.user}/>
          <Switch>
            <Route path="/login"    render={ (props)=>{ return <Login {...props} /> }} />
            <Route path="/register" render={ (props)=>{ return <Register {...props} /> }} />
          </Switch>
          {this.state.list && <Todo data={this.state.list}/> }
          {this.displayFinishedTags && <FinishedTasks /> }
          {/* <FinishedTasks /> */}
      </React.Fragment>
    );
  }
}

export default App;
